import React from 'react';
import Sidebar from './Sidebar';
import JobCard from './JobCard'; // Assuming you create a separate JobCard component
import styles from '../css/UserHome.module.css'; // Import the CSS module

const jobs = [
  {
    id: 1,
    title: 'Fullstack Developer',
    company: 'Nseit',
    location: 'Mumbai',
    salary: '3.5 to 10LPA',
    experience: '4-6 Yrs',
  },
  // Add more job data
];

const UserHome = () => {
  return (
    <div className={styles['employer-home']}>
      <Sidebar />
      <div className={styles['main-content']}>
        <h1>Welcome to the User Screen!</h1>
        {jobs.map((job) => (
          <JobCard key={job.id} job={job} />
        ))}
      </div>
    </div>
  );
};

export default UserHome;
